for i, s in enumerate(stabilizers):
    if len(s) != 138:
        print(f"Stabilizer {i} has length {len(s)} != 138")

# Attempt to create tableau
try:
    pauli_stabilizers = [stim.PauliString(s) for s in stabilizers]
    tableau = stim.Tableau.from_stabilizers(pauli_stabilizers, allow_underconstrained=True)
    print("Tableau creation successful.")
    circuit = tableau.to_circuit()
    print("Circuit generated.")
    with open("circuit_138.stim", "w") as f:
        f.write(str(circuit))
    print("Circuit saved to circuit_138.stim")
except Exception as e:
    print(f"Tableau creation failed: {e}")

# Check commutativity
print("Checking commutativity...")
anticommuting_pairs = []
for i in range(len(stabilizers)):
    for j in range(i + 1, len(stabilizers)):
        s1 = stim.PauliString(stabilizers[i])
        s2 = stim.PauliString(stabilizers[j])
        if not s1.commutes(s2):
            anticommuting_pairs.append((i, j))

if anticommuting_pairs:
    print(f"Found {len(anticommuting_pairs)} anticommuting pairs.")
    for i, j in anticommuting_pairs:
        print(f"  {i} and {j} anticommute")
        print(f"  {i}: {stabilizers[i]}")
        print(f"  {j}: {stabilizers[j]}")
        # Find overlap
        s1 = stabilizers[i]
        s2 = stabilizers[j]
        overlap = []
        for k in range(len(s1)):
            if s1[k] != 'I' and s2[k] != 'I' and s1[k] != s2[k]:
                 overlap.append(k)
        print(f"  Indices where they clash: {overlap}")
else:
    print("All stabilizers commute.")
